import React from 'react';
import './users.css';

function Users() {
    return (
    <div className='users'>
        <h2>Working with GET request</h2>
         <div class="card">
            <div class="card-header">Header</div>
            <div class="card-body">Content</div>
            <div class="card-footer">Footer</div>
        </div>
    </div>
    )   
}
export default Users;
